import { DropdownItemProps } from 'semantic-ui-react';

export const sortOptions: DropdownItemProps[] = [
  { label: 'alphabetical order', value: 'letter', key: 'letter' },
  { label: 'latest commit', value: 'commit', key: 'commit' },
  { label: 'favorites', value: 'favorites', key: 'favorites' },
];
